	<div class="container-fluid">
    <div class="cdreport-header-box">
            <h3 class="cdreport-header"><small>Utiliser le rapport pour votre</small><strong>Planification de carrière&nbsp;</strong></h3>
    </div>
</div>
<div class="container">
        <div class="margin-top-2x margin-bottom-2x text-center"><img id="img-badges" src="./Career Direct® _ Rapport détaillé - Emmanuel MORDIVA LANDU_files/CareerBlocks.jpg"></div>
        <p><span class="cdreport-user">Emmanuel</span>, le principe sous-jacent l’utilisation de ce rapport est que les personnes dont le travail correspond à leur personnalité, leurs compétences et leurs valeurs sont en général épanouies dans leur métier et ont du succès. Par conséquent, votre retour sur les quatre domaines ci-dessous vous apportera des informations précieuses pour votre planification de carrière. Avant de prendre une décision de carrière, il faut considérer chacun de ces domaines.</p>
        <p>Vos résultats ne vous indiqueront pas un seul métier possible. Vous obtiendrez plutôt des informations clés qui vous aideront à comprendre votre personnalité unique et le genre de travail qui vous correspondrait bien. L'approche généraliste est bien meilleure, car il y a en général plusieurs professions similaires qui correspondent aux intérêts et aux talents d'une personne. Le fait d'utiliser le formulaire du système d'orientation  de Career Direct® vous permettra d'affiner vos options vers un bon choix de métier. Le fait d'utiliser vos talents et vos intérêts pour bien gérer votre carrière vous sera utile aussi bien maintenant que dans l'avenir.</p>
        <h3 class="cdreport-header">TIRER LE MEILLEUR PARTI DE VOTRE RAPPORT</h3>
        <p>Ce rapport contient de nombreuses informations, vous devrez certainement les relire plusieurs fois. Vous pourriez aussi beaucoup gagner à le montrer à une tierce personne, comme par exemple, un ami, votre conjoint, ou un mentor. En général, une personne qui a une personnalité différente de la vôtre peut être particulièrement utile pour faire ressortir des points que vous pourriez ne pas avoir pris en compte. Si vous décidez de faire appel à un(e) consultant(e)&nbsp;d’orientation pour votre orientation de carrière, ce rapport permettra de fournir un aperçu détaillé sur vos possibilités et potentiels. Comme mentionné précédemment, l'étape la plus utile&nbsp; pour obtenir le plein bénéfice de ce rapport est de suivre le plan d’action de votre SYSTEME D’ORIENTATION de Career Direct<span>  ®</span>  .</p>

        <div class="margin-page">&nbsp;</div>
        <div class="page-break"></div>

        <h3 class="cdreport-header">Rapport de système d’orientation complet de Career Direct<span>  ®</span></h3>
        <h3 class="cdreport-header">ORGANISATION DU RAPPORT</h3>
        <p>Le rapport est organisé en quatre domaines principaux: personnalité, centres d'intérêts, compétences et valeurs. Chacun de ces domaines apporte des éclairages importants sur ce qui fait de vous une personne unique. Vous pouvez trouver des définitions de tous les groupes dans ce rapport dans l’echantillonnage de métiers qui se trouve dans votre SYSTEME D’ORIENTATION de Career Direct<span>  ®</span>  .</p>
        <ol>
                <li><a href="#ConceptOfPersonality" class="scroll-to"><strong>Personnalité</strong></a>. Le rapport débute par la section sur la personnalité, dans laquelle vous trouverez une analyse de six facteurs de personnalité dans la vue d'ensemble sur votre personnalité, avec vos points forts et vos points faibles typiques, ainsi que votre environnement de carrière fondé sur votre profil de personnalité unique.</li>
                <li><strong>Centres d'Intérêts</strong>. Dans cette section vous découvrirez un classement de vos intérêts selon 21 groupes d’intérêts généraux de carrière et les descriptions des groupes de carrière qui sont le plus pertinents pour vous. Ces larges regroupements de métiers proviennent de la section des centres d'intérêts professionnels dans l’inventaire. Vos scores reflètent votre niveau d’intérêt dans les 21 groupes de professions. Il y a également un tableau qui liste les composants qui produisent vos huit intérêts principaux: les activités, métiers et groupes de sujets.</li>
                <li><strong>Compétences et Capacités</strong>. Vous trouverez ici un tableau de vos compétences dans 14 domaines et des descriptions de vos compétences et capacités les plus fortes.</li>
                <li><strong>Valeurs</strong>. Cette section est divisée en trois parties: l’environnement de travail, les attentes et les valeurs de vie.  Vos quatre priorités principales dans chaque domaine seront mises en évidence.</li>
        </ol>

        <h3 class="cdreport-header">Comprendre les barèmes et les scores</h3>
        <p>Les barèmes de toutes les sections sont fondés sur des scores standardisés qui proviennent des réponses qui ont été données par un large échantillonnage de la population ayant réussi dans différents métiers. Les barèmes vous donnent un moyen de visualiser et de comparer vos scores avec les scores d’autres travailleurs typiques. Les barèmes vous permettront également de facilement relever les tendances. Vous trouverez ci-dessous un exemple du barèmes utilisé.</p>
