        <p>Le graphique à barres modèle ci-dessus montre différentes échelles de personnalité. La gamme de note standard sur le graphique varie de +30(à gauche) à 0(au milieu) à +30(à droite). Il y a donc une variation de 60 points et le score moyen est 0 (au milieu). Pour chaque facteur, environ un tiers de la population aura un score à droite (entre +6 et +30), un autre tiers au milieu (entre +5 à gauche et +5 à droite), le dernier tiers à gauche (+6 et +30). Veuillez interpréter le score sur l’échelle comme indiqué ci-dessous.</p>
