		<p>Une fois encore, en terme de personnalité, aucune n’est meilleure que l’autre (p.ex. Extraverti ou Introverti). Chacun doit utiliser les points forts propres à sa personnalité unique.</p>
		<p>Ces facteurs ont été choisis après des recherches approfondies, et ils sont en accord avec d’autres mesures reconnues des traits communs de personnalité.</p>
		<p>Chaque facteur est associé à une plage de comportements. Par exemple, ceux ayant obtenu un score élevé "extraverti" auront spontanément un comportement totalement différent de ceux qui ont un score élevé "introverti" quand ils rencontrent des personnes inconnues. Ceux qui obtiennent un score dans la moyenne présentent en général un comportement mixte. En lisant cette section, gardez en tête le fait qu'à chaque personnalité correspondent des points forts et des points faibles.</p>

