		<h3 class="cdreport-header">CONFIRMER LE BILAN DE VOTRE PERSONNALITE</h3>
		<p>Cette section, tout comme le reste de votre rapport, a été élaborée sur la base des réponses que vous avez données. Elle reflète des profils types de personnes qui ont des scores similaires aux vôtres. Les rapports sont en général assez justes, mais il est possible que tous les points ne s’appliquent pas pour vous. Vous aurez donc besoin de confirmer les informations qui vous sont présentées. Etudiez le rapport selon la connaissance que vous avez de vous-même, et demandez également à une personne de confiance de confirmer ces données. Concentrez-vous sur les parties qui vous décrivent de manière précise.</p>
                <div class="page-break"></div>
		<a name="YourPersonalityHighlights"></a><h4 class="cdreport-header">1.2 VOS FACTEURS ET SOUS-FACTEURS DE PERSONNALITE</h4>
		<p><span class="cdreport-user">Emmanuel</span>, les trois pages suivantes listent vos six facteurs de personnalité. Ils sont listés du plus prononcé au moins prononcé.</p>

		<div style="page-break-inside: avoid">
