		<div class="personalty-highlights-explanation">
			<p class="text_b">        Votre score dans le facteur<b>        AVENTURE</b>         indique que vous vous épanouissez face à de nouveaux défis. Vous abordez sûrement avec confiance les situations qui comprennent des risques. Votre esprit pionnier vous pousse à vous lancer dans de nouveaux domaines sans hésitation.</p><p class="text_b">        Votre principal point fort est votre niveau élevé de courage et d'initiative. Atteindre votre but est quelque chose de très important pour vous.&nbsp;Vous vous surprenez probablement à vous fixer des objectifs très élevés et à tout mettre en œuvre pour les atteindre. Votre ambition est grande et votre attitude très compétitive. De ce fait, vous aurez tendance à chercher à atteindre des buts quantifiables et mesurables. Vous vous attendez probablement à gagner chaque fois que vous relevez un défi.</p><p class="text_b">    Attention de ne pas pousser trop loin ces traits de caractère. Par exemple, vous pourriez être compétitif(ve) au point de marcher sur les plates-bandes d'autrui ou de les manipuler dans le but d'atteindre les buts qui vous tiennent à cœur. D'autre part, votre confiance naturelle dans vos capacités à réussir peut par moments vous conduire à penser que vous avez raison sur tout. Avoir des conseillers qui ne seront pas forcément d'accord avec vous et vous aideront à évaluer d'autres aspects afin de prendre vos décisions avec justesse serait bénéfique. &nbsp;Finalement, vous serez plus efficace en contrebalançant votre audace naturelle avec une mesure de prudence.</p>
		</div>

