			<p class="text_b">Emmanuel, votre score dans le facteur <b>   INNOVATION</b>    montre que vous êtes une personne très créative. Vous excellez dans la création de nouvelles solutions et idées, même si elles paraissent un peu inhabituelles pour les autres. Vous vous surprenez peut-être à rêver en plein jour ou à jouer avec des idées sous des angles variés. Il se peut que vous exprimiez votre créativité de différentes manière, y compris par la résolution de problèmes logiques, le travail manuel ou des aventures plus artistiques, telles que l'écriture, la musique, le théâtre ou les arts visuels.</p><p class="text_b">   Vous avez peut être aussi une tendance à être rapide d'esprit et doué(e). Il peut vous sembler naturel de rechercher des défis intellectuels. Vous êtes heureux(se) si vous pouvez réfléchir, c'est pour vous presque un divertissement. Il vous semble facile d'analyser des sujets en profondeur et de manière plus large.</p><p class="text_b">   Si la créativité et l'imagination sont des valeurs capitales dans beaucoup de situations, elles peuvent être surestimées dans leur efficacité si des étapes pratiques ne sont pas envisagées pour leur application. Vous pouvez avoir de la difficulté à rester concentré(e) et à suivre des projets que vous avez initiés. Il se peut que vous oubliiez facilement des tâches quotidiennes et pratiques. Faites une liste de ces projets, imposez des dates limites, engagez-vous de manière à rendre des comptes sont autant de choses qui peuvent vous aider à augmenter votre efficacité.</p>
