				<h4>Incidences sur la carrière</h4>
				<div class="career-implications">
					<p>        Votre score dans le facteur COMPASSION est relativement élevé. Privilégiez des activités qui vous permettent de soutenir des personnes dans un environnement chaleureux. Essayez d'éviter au maximum un contexte professionnel qui exige de vous que vous confrontiez les gens ou que vous soyez confronté(e) au rejet ou aux conflits de manière régulière. Dans votre environnement de travail idéal, recherchez une activité professionnelle qui offre:</p><span class="row cdreport-horizontal-list"><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>     la gentillesse</span><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>      la tolérance</span><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>      un haut niveau de confiance</span><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>      la stabilité</span><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>      l'harmonie</span><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>l'occasion d'aider les autres.</span></span>
