		<div class="personalty-highlights-explanation">
			<p class="text_b">     Votre score dans le facteur <b>     COMPASSION</b>      indique que vous êtes une personne compréhensive, qui manifeste de la compassion. Votre sensibilité vous permet d'être attentif(ve) aux blessures et aux difficultés de ceux qui vous entourent. Vous pouvez écouter avec patience et sans jugement, ce qui vous permet d'avoir une profonde influence sur les autres, notamment dans des entretiens individuels.</p><p class="text_b">   Comme les gens ressentent votre préoccupation sincère et votre attention, ils auront naturellement envie de se confier à vous. Dans ces circonstances, vous trouverez aisément les mots pour les encourager et leur porter conseil.</p><p class="text_b">     Votre personnalité agréable vous rend capable de vous adapter à pratiquement toutes les situations, pourvu qu'il y ait de l'harmonie. Les conflits peuvent vous stresser. De ce fait, soyez attentif(ve) au climat régnant dans une organisation et une équipe de travail avant de prendre un engagement professionnel avec ces personnes.</p>
