					<p>       Sur la base de votre score EXTRAVERSION, vous serez au mieux dans une activité centrée sur les relations humaines. Recherchez un environnement professionnel qui vous permettra d'être en contact avec d'autres personnes de manière amicale et qui vous offrira l'opportunité de:</p><span class="row cdreport-horizontal-list"><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>     parler/expliquer</span><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>     promouvoir</span><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>     encourager</span><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>     exprimer</span><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>     mettre des personnes en contact</span><span class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i>     utiliser l'humour</span></span>
