		<div class="personalty-highlights-explanation">
			<p class="text_b">     Votre score dans le facteur <b>     EXTRAVERSION</b>      est typique de ceux qui cherchent à avoir de fréquentes interactions avec les gens et qui ont un don pour s'exprimer verbalement. Votre haut niveau d'énergie se lit probablement dans votre gestuelle, votre conversation enthousiaste et les sourires fréquents qui éclairent votre visage lorsque vous parlez à quelqu'un. Lorsqu'il s'agit d'être persuasif(ve) et convaincant(e), vous relevez le défi et êtes capable de faire une impression positive sur de grands groupes de personnes.</p><p class="text_b">     En tant que personne orientée sur les relations, vous envisagez probablement avec beaucoup d'enthousiasme les possibilités de réseautage lors de conventions, réunions, rencontres, fêtes et autres activités sociales.</p><p class="text_b">     Un autre port fort est votre style spontané et sans inhibition. Vous n'êtes pas coincé(e) et vous avez probablement un don pour impliquer des personnes plus timides dans des activités de groupe. Vous êtes probablement stimulé(e) par les occasions de vous exprimer devant une grande audience.</p><p class="text_b">Emmanuel rappelez-vous qu'une force exagérée peut devenir une faiblesse. Vos talents d'élocution sont un vrai capital, mais la sagesse consiste aussi à savoir quand se taire et écouter. En étant plus conscient(e) de la manière dont d'autres personnes vous perçoivent, vous aurez plus de facilité à considérer leurs intérêts et leurs besoins d'échanges. Pour une efficacité maximum, prenez plus en compte votre entourage et adaptez votre comportement en conséquence.</p>
