		<div class="personalty-highlights-explanation">
			<p class="text_b">Emmanuel, votre score dans le facteur <b>       DOMINATION</b>        montre que vous avez une motivation naturelle à être aux commandes de votre environnement. Cette motivation à diriger s'exprime probablement de diverses manières dans votre vie. Que ce soit en conduisant votre voiture, en planifiant des vacances, en établissant vos priorités dans votre travail, vous vous faites naturellement plus confiance à vous-mêmes qu'à quiconque et vous désirez avoir les choses en main. Vous avez probablement remarqué que vous avez tendance à éviter les situations dans lesquelles vous êtes limité par les intentions de quelqu'un d'autre.</p><p class="text_b">       Votre nature confiante et décidée vous qualifie bien pour un rôle de leader. Vous avez un désir inné d'influencer les autres et cela peut contribuer à votre succès en politique, dans la vente et activités similaires. La plupart des personnes qui ont un score élevé dans la DOMINATION tendent à opérer à partir d'une perspective globale. Cela vous offre la possibilité unique d'anticiper les changements et de concevoir des idées nouvelles pour l'avenir. Ce don de «&nbsp;visionnaire&nbsp;» est l’un de vos points forts principaux.</p><p class="text_b">       Vous pouvez avoir un fort désir d'indépendance et vous avez probablement vos propres opinions sur la manière de faire les choses. Pour vous, il est naturel d'exprimer vos idées et vos opinions.</p><p class="text_b">       Certaines faiblesses caractérisent ceux qui sont de nature à prendre des responsabilités. En voulant à tout prix contrôler la situation, vous pouvez vous retrouver à travailler ou à vous impliquer dans des domaines où vous manquez d'expertise ou de connaissance. Souvenez-vous aussi que vous avez tendance à sous-estimer ou sous-évaluer la somme de travail nécessaire à l'accomplissement de vos grandes idées. En général, une approche plus prudente et l'écoute de conseils avisés d'une personne dont la personnalité serait opposée à la vôtre vous seront d'une grande aide.</p>
