		<div class="personalty-highlights-explanation">
			<p class="text_b">        Votre score sur le barème <b>        CONSCIENCE PROFESSIONNELLE</b>         indique chez vous une motivation forte pour vivre de manière non structurée. Dans beaucoup de domaines, vous préférez probablement suivre vos propres règles et priorités plutôt que de devoir subir celles des autres. Typiquement, vous avez tendance a croire que vous pouvez résoudre tout problème qui surgirait. En fait, vous aimez probablement les nouveaux problèmes parce qu'ils vous offrent une opportunité d'improviser et d'agir sans préparation.</p><p class="text_b">        L’un de vos points forts principaux consiste à voir les choses d'une manière nouvelle et sous un angle différent, en-dehors des sentiers battus. Cela vous donne l'occasion d'exposer des points de vue innovants qui peuvent conduire à une nouvelle manière de faire ou même à la création d'un tout nouveau produit.</p><p class="text_b">        Un autre point fort typique de ceux qui obtiennent un score équivalent dans ce domaine est la capacité de se concentrer sur la vision d’ensemble et d'éviter de s'enferrer dans tout ce qui pourrait ressembler même de loin à une activité fébrile.</p><p class="text_b">        Vos points forts peuvent aussi avoir des conséquences négatives si ils sont trop accentués. Rappelez-vous que tout le monde doit suivre des règles d'une manière ou d'une autre et que nous pouvons tous bénéficier de l'expérience et de la sagesse des autres. Un autre piège pourrait aussi être celui d'une certaine incohérence ou d'un manque de suivi. Tâchez d'établir des bonnes habitudes dans votre quotidien. Au final, nous devons tous maîtriser certaines tâches détaillées pour survivre et obtenir le succès désiré. En équilibrant votre besoin d'autonomie avec une discipline personnelle, vous serez mieux équipé(e) pour atteindre votre plein potentiel.</p>
