		<a name="TypicalStrengths"></a><h4 class="cdreport-header">1.3 Points forts typiques</h4>
		<p><span class="cdreport-user">Emmanuel</span>, vous trouverez ci-dessous une liste de points forts qui sont typiques des personnes ayant répondu comme vous. Recherchez les métiers qui vous permettront de mettre en avant ces points forts. Plus vous serez en mesure d’utiliser ces points forts dans votre travail, plus vous serez épanoui(e) et couronné(e) de succès. Comme nous l’avons déjà mentionné précédemment, il faut que vous vérifiiez ces données avec quelqu’un qui vous connaît bien et qui pourra confirmer si tous ces éléments vous correspondent.</p>
		<ul class="cdreport-list">

				<li>Orienté(e) vers le leadership; aime naturellement influencer les autres et prendre la responsabilité d'une situation.</li>

				<li>Bon(ne) équipier(e).</li>

				<li>Direct(e), courageux(se) dans l'adversité.</li>

				<li>Energique, positif(ve) et enthousiaste; aime s'impliquer dans différentes activités.</li>

				<li>Sociable, s'intègre facilement, motivé(e) par la rencontre de nouvelles têtes.</li>

				<li>Bon(ne) pour encourager les autres.</li>

				<li>Agréable. Etablit facilement le contact avec les autres.</li>

				<li>Opère à partir d'une perspective généraliste.</li>

				<li>Peut répondre sur le champ sans préparation excessive.</li>

				<li>Pionnier(ère), aime prendre des risques calculés.</li><li>    Calme et confiant(e) dans l'adversité.</li>

				<li>Ambitieux(se) et sachant saisir les opportunités. Fort désir d'y arriver et d'avoir du succès.</li>

				<li>Créatif(ve), imaginatif(ve), original(e). Bon(ne) pour trouver de nouvelles idées.</li>

				<li>Rapide d'esprit, capable de saisir des concepts abstraits.</li><li>   Doué(e) pour trouver et mettre en place des solutions aux problèmes.</li>

		</ul>
		</div>
		<div style="page-break-inside: avoid;">
		<a name="TypicalNonStrengths"></a><h4 class="cdreport-header">1.4 Points faibles typiques</h4>
		<p>Vous trouverez ci-dessous une liste de points faibles qui sont typiques des personnes ayant répondu comme vous. Le fait d’améliorer ces domaines vous permettra d’accroître vos performances. De plus, essayez d’éviter autant que possible de vous impliquer dans des domaines qui ne sont pas vos points forts. Comme mentionné précédemment, il faut que vous vérifiiez ces données avec quelqu’un qui vous connaît bien et qui pourra confirmer si tous ces éléments vous correspondent.</p>
		<ul class="cdreport-list">

				<li>Peut forcer les choses dans le but d'obtenir des résultats.</li>

				<li>Hésitant(e) au moment de prendre une décision.</li>

				<li>Oublie que tout le monde n'est pas à l'aise avec le franc-parler.</li>

				<li>Peut être trop optimiste quant à l'avenir ou sur les gens.</li>

				<li>Peut avoir un problème avec la gestion de son temps et à garder le fil d'une conversation.</li>

				<li>A de la difficulté à dire "non".</li>

				<li>Peut être stressé(e) par un conflit et n'aime pas la confrontation.</li>

				<li>Peut sous-estimer des faits importants; tire des conclusions hâtives.</li>

				<li>Peut manquer de concentration; tend à passer d'un sujet à l'autre.</li>

				<li>Peut prendre des risques inutiles.</li>

				<li>A tendance à trop se concentrer sur ses buts personnels, peut tendre à sacrifier sa famille pour le succès.</li>

				<li>Facilement ennuyé(e) par les procédures établies.</li>

				<li>Peut avoir une attitude de supériorité.</li>

		</ul>
