		<p class="text_b">  Votre score dans le facteur <b>  STRESS</b>   indique que vous êtes de manière générale plutôt content(e) et que vous vous êtes adapté(e) de manière efficace à gérer le stress dans votre vie. Typiquement, vous prenez les choses sans vous laisser démonter. Vous êtes quelqu'un qui reste calme et d'un tempérament égal dans des situations difficiles. Cela peut être une indication de votre comportement habituel ou cela peut indiquer que vous n'avez pas de source de stress majeure dans votre vie actuellement. Parfois, des scores très faibles pourraient indiquer une tendance à nier les difficultés. Discutez-en avec un membre de votre famille ou un ami de confiance qui puisse vous aider à discerner votre situation précise.</p>
