		<a name="FiveMajorGeneralInterestAreas"></a><h3 class="cdreport-header"><span class="cdreport-header-part">Partie 2:  Centres d'Intérêts </span><strong>Cinq principaux domaines de centres d’intérêts</strong></h3>
	</div>
</div>
<div class="container">
	<p><span class="cdreport-user">Emmanuel</span>, découvrir vos intérêts généraux est une étape essentielle dans le processus de planification de carrière pour une simple raison: c'est plus facile de donner le meilleur de soi-même quand on est passionné par son travail! Ce qui peut sembler fastidieux pour l'un sera une tâche facile et agréable pour un autre naturellement équipé pour ce travail. En général, le travail qui vous intéresse vous semblera agréable même s’il implique des tâches qui en d’autres circonstances seraient difficiles ou ennuyeuses.</p>
	<p>De par la nature même de vos intérêts, vos préférences en termes de loisirs vont probablement influencer vos scores de centres d'intérêts. Cela implique du discernement lors de l'interprétation de la section des centres d'intérêts de votre rapport.</p>
	<p>Par exemple, si vous aimez l’exercice physique et le sport, "Athlète" peut ressortir très haut dans la liste de vos centres d'intérêts. Cependant, peu de personnes deviennent des athlètes professionnels. Reconnaissez alors ce score élevé pour ce qu’il est: quelque chose que vous ferez pour le plaisir et non pas de manière professionnelle.</p>
	<p>D’un autre côté, <span class="cdreport-user">Emmanuel</span>, plus vous pourrez faire correspondre votre travail avec des domaines qui vous passionnent, et plus vos chances seront grandes d’avoir du succès. Quelqu’un qui aimait tirer à l’arc est devenu le meilleur vendeur chez un fabricant de matériel pour le tir à l’arc de par son grand intérêt pour ce sport et les activités de plein air. De la même manière, de nombreuses personnes développent des entreprises à succès basées sur leurs hobbies. Gardez en mémoire que plus vous apprécierez ce que vous faites, plus vous serez satisfait(e) au travail, et moins vous serez stressé(e) par votre activité professionnelle.</p>
	<p>Il y a diverses manières de catégoriser les centres d'intérêts professionnels. Ce rapport utilise 21 groupes de professions qui se répartissent en cinq domaines d’intérêts de carrière, comme indiqué ci-dessous.</p>
