	<a name="TopEightCareerGroups"></a><h4 class="cdreport-header">2.1 Huit premiers groupes de professions</h4>
	<p> Les trois éléments activités, métiers et sujets d’études déterminent vos scores de groupes de centres d'intérêts professionnels. Ces centres d'intérêts peuvent être liés soit à votre travail, soit à vos loisirs, ou ils peuvent être des activités de loisirs ou un hobby que vous utiliserez comme fondement pour une carrière. Du fait que les groupes de centres d’intérêts professionnels sont divisés en différentes parties, il se peut qu’un groupe d’activité soit très important pour vous, mais que d’autres éléments du groupe ne le soient pas. En conséquence, ce centre d'intérêt ne figurera pas en haut de la liste des centres d'intérêts. Par exemple, il se peut que vous aimiez les maths mais ne soyez pas intéressé(e) par la finance, ce qui fait que votre score dans le groupe de centres d'intérêts professionnels informatique/finance, ne sera pas élevé. </p>
	<p> La suite vous donne un rapport détaillé sur ce qui constitue vos scores de groupes de professions. Pour chaque catégorie d’intérêts, vous trouverez vos scores d’activités, de métiers et de sujets. </p>
	<p> NB: tous les groupes ont des activités, mais tous n’ont pas forcément des groupes de métiers ou de sujets équivalents. </p>
