			<p>Ce groupe de carrière est centré sur les activités telles qu'apporter une direction spirituelle ou religieuse et écouter les problèmes personnels des autres. Les activités typiques de ce domaine sont d'encourager la participation à des services religieux, de parler à d'autres personnes de questions spirituelles, et de présider des offices religieux. Bon nombre des personnes qui ont un intérêt profond pour ce domaine donnent bénévolement de leur temps plutôt que d'être impliquées dans une poste à plein temps. Les métiers peuvent être les suivants:</p>
