			<p>Les professions dans ce groupe sont liées au fait de communiquer des idées au travers de l'écrit, comme par exemple écrire des récits et des articles, des scripts pour la télévision et des critiques cinématographiques. La rédaction publicitaire ou la rédaction de discours sont également des exemples de tâches effectuées par des personnes intéressées par ce type d'activité. Les métiers peuvent inclure:</p>
			<div class="cdreport-container text-center">
					<div class="row cdreport-horizontal-list">

						<div class="col-xs-4 cdreport-horizontal-list-item"><i class="fa fa-check"></i> Journaliste</div>

