	<a name="PotentialOccupations"></a><h4 class="cdreport-header">2.3 Métiers potentiels dans vos premiers groupes</h4>
	<p> <span class="cdreport-user">Emmanuel</span>, Vos huit premiers groupes carrière décrits dans les pages précédentes donnent des définitions générales de larges groupes de professions pour lesquelles vous avez un niveau d’intérêt important. Certaines des descriptions et des professions dans les groupes ne vous intéresseront peut-être pas. Ce n’est pas un problème; prenez simplement note de ce que vous n’aimez pas et utilisez cela comme un critère pour réduire vos intérêts de carrière. Il est évident que les informations données par les autres sections de ce rapport, le formulaire d'inscription à Career Direct<span>  ®</span>   et la section ressources du site Career Direct<span>  ®</span>   vous aideront dans ce processus. </p>
	<p> Des listes détaillées des différents métiers dans ces groupes, ainsi que d’autres, vous sont présentées dans l’echantillonnage de métiers qui complète l’évaluation Career Direct<span>  ®</span>  . Plus de 1600 professions y sont listées, regroupées en cinq domaines de centres d’intérêts (Agir, Aider, Influencer, Analyser, Exprimer). Ces catégories élargies de carrière sont organisées en 21 groupes de centres d'intérêts professionnels, tout comme dans votre rapport, et en nombreux regroupements de carrière. </p>
	<h4 class="cdreport-header cdreport-header-alt">PRENEZ NOTE DE VOS CENTRES D’INTERETS LES PLUS FAIBLES</h4>
