		<p>Soigner des animaux malades ou blessés, dresser des animaux, prendre soin d'animaux ou étudier le comportement animal.</p>

	<p> NB: les centres d'intérêts professionnels ne sont pas la même chose que les compétences. Ils reflètent votre intérêt pour un champ de carrière, mais pas votre compétence à travailler dans ce champ. La plupart des gens ont des compétences qui collent avec leurs intérêts. Si tel n’est pas le cas, ils essaient en général de développer davantage leurs compétences ou cherchent un domaine de carrière parallèle. Par exemple, une personne qui aime le sport, mais qui n’a pas les compétences pour devenir sportif professionnel, pourrait décider de devenir entraîneur ou arbitre. </p>
