	<div style="page-break-inside: avoid;">
	<a name="EvaluateYourSkills"></a><h4 class="cdreport-header">3.2 Compétences et Capacités: Evaluez vos compétences</h4>
	<p>Examinez attentivement vos compétences les mieux notées et analysez les liens qu’elles ont entre elles. Combien d’entre-elles se rejoignent? Y-a t’il un thème commun entre elles? Est-ce que certaines de vos compétences sont plus liées avec des domaines que vous qualifieriez de hobby? Si c’est le cas, est-il possible d'implémenter ces compétences dans votre travail? Le Plan d’Action décrit à la fin de ce rapport vous aiguillera au travers de ces questions, et bien d'autres encore. Compléter cette analyse vous aidera à tirer plein bénéfice de ce rapport.</p>
	</div>

	<div style="page-break-inside: avoid;">
	<h4 class="cdreport-header cdreport-header-alt">DEVELOPPEZ VOS COMPÉTENCES</h4>
	<p>Exploitez vos points forts naturels ne signifie en aucun cas que la formation, l’enseignement, l'effort et l’engagement ne sont pas nécessaires pour développer davantage vos compétences. Au contraire, la plupart des professionnels à succès le deviennent en travaillant assidûment. Pensez à un golfeur professionnel qui développe de bonnes compétences physiques en frappant des centaines de balles par jour. De la même manière, observez un pianiste qui va passer des heures à répéter afin de pouvoir développer pleinement ses compétences musicales naturelles.</p>
	</div>

	<div style="page-break-inside: avoid;">
	<h4 class="cdreport-header cdreport-header-alt">OPTEZ LE MOINS POSSIBLE POUR DES METIERS POUR LESQUELS VOUS AVEZ OBTENU DE FAIBLES SCORES DE CAPACITES</h4>
	<p><span class="cdreport-user">Emmanuel</span>, comme pour vos intérêts, veuillez prendre note des domaines de compétences dans lesquels vous avez obtenu les scores les plus faibles. Ce sont ceux qui sont listés en bas du tableau de la page précédente. Les domaines où vous avez obtenus de faibles scores peuvent apporter un éclairage supplémentaires sur vos choix de carrière. Il se peut que ce ne soit pas des points forts naturels, ou que vous n’ayez jamais eu l’occasion de les développer. Dans les deux cas, il est préférable de ne pas opter pour les métiers qui nécessiteraient d’utiliser intensément vos compétences les plus faibles, à moins que vous ne vous formiez davantage au préalable.</p>
