<div class="container">
	<h4 class="cdreport-header">Les valeurs sont importantes dans les choix de carrière</h4>
	<p><span class="cdreport-user">Emmanuel</span>, il se peut que vous soyez dans un domaine de carrière qui corresponde bien à vos intérêts professionnels, vos compétences et aux points forts de votre personnalité, mais que malgré tout vous ne soyez pas satisfait(e) et stressé(e) au votre travail. Cela vient du fait que votre métier ne correspond pas à vos valeurs. Par exemple, de nombreuses personnes aiment travailler en extérieur et ne pourront par conséquent jamais être pleinement satisfaites en restant enfermées. Des autres ont besoin de venir directement en aide aux autres, et ainsi ne seront pas comblées en travaillant seules ou avec des machines.</p>
	<p>De nombreuses personnes pensent qu’elles peuvent être heureuses en faisant n’importe quoi, dans la mesure où elles ont du succès au niveau matériel. Bien trop souvent, elles ne se sentent pas épanouies et sont épuisées après seulement quelques années dans leur carrière. Utiliser les valeurs comme un critère de choix de carrière peut prévenir de nombreuses déceptions et éviter une bonne partie du stress dans le monde du travail d’aujourd’hui. Alors que vous étudiez vos priorités pour voir si elles coïncident avec les trois autres parties du rapport, comparez-les avec la manière dont vous opérez maintenant au travail. Cette section sur les valeurs est conçue en trois parties afin de vous aider à définir les priorités et les valeurs qui vous dirigeront dans votre vie et votre travail.</p>
	<p>Attendez-vous à ce que vos valeurs changent; ce sont vos priorités et vous pouvez en changer à tout moment. La plupart des gens verront qu’ils changeront certaines de leurs priorités en vieillissant, ou quand leur situation familiale change. Il peut être intéressant de conserver ce rapport pour y revenir dans le futur. Une relecture périodique vous permettra de faire des mises à jour et de voir à quel point vous avez réussi à respecter vos priorités.</p>

