	<h4 class="cdreport-header cdreport-header-alt">CONSIDEREZ LES QUATRE PREMIERES COMME UN CRITERE IMPORTANT DANS L’EVALUATION DE METIERS ET DE POSTES POTENTIELS</h4>

		<div style="page-break-inside: avoid;">
		<h5><b>1. Harmonie</b></h5>
		<p>Vous appréciez avoir un environnement de travail qui soit agréable et harmonieux. Recherchez des emplois dans lesquels vous n'aurez que peu de confrontation, où vous serez en harmonie avec vos collègues et votre patron, au sein d'une équipe de collègues qui vous respectent.</p>
		</div>

		<div style="page-break-inside: avoid;">
		<h5><b>2. Equité</b></h5>
		<p>Vous recherchez un métier où tous sont traités de manière équitable, peu importe leur race, leur sexe, leur croyance, leur religion ou leur nationalité. Cherchez des opportunités de carrière dans lesquelles les employés sont payés de manière équitable pour les mêmes compétences et où toutes les positions sont pourvues sans discrimination.</p>
		</div>

		<div style="page-break-inside: avoid;">
		<h5><b>3. Défi</b></h5>
		<p>Vous recherchez les opportunités de résoudre des cas difficiles et des situations de quitte ou double. Recherchez des missions difficiles et des obstacles à surmonter. La controverse n'est pas un problème, car vous aimez restaurer l'ordre là où règne le chaos.</p>
		</div>

		<div style="page-break-inside: avoid;">
		<h5><b>4. Un environnement propre</b></h5>
		<p>Dans votre travail, cherchez des emplois où vous n'aurez pas à vous salir et où vous ne serez pas exposé à de fortes odeurs. Vous appréciez un environnement de travail qui est propre, hygiénique et bien ordonné. Votre situation de travail idéale est quand l'environnement et les tâches à accomplir vous permettent de rester propre et soigné toute la journée.</p>
		</div>

	</div>

	<div style="page-break-inside: avoid;">
	<a name="WorkOutcomes"></a><h4 class="cdreport-header">4.2 Valeurs: Vos attentes vis-à-vis de votre travail</h4>
	<p>Bien que l'on soit en droit d'avoir un certain nombre d’attentes concernant ce que leur travail devrait nous offrir, il est important de les hiérarchiser. Par exemple, de plus longues études et un revenu plus élevé vont en général de paire. Cependant, au-delà d’un certain niveau, continuer des études ne rime pas nécessairement avec un revenu plus élevé. De la même manière, le fait de se trouver dans une position de dirigeant n’est pas forcément un gage de sécurité. Que ce soit de manière réfléchie ou non, la plupart d’entre-nous devons faire des choix difficiles dans ce domaine.</p>
	<p>Il est essentiel que vous reconnaissiez que vos priorités sont une question personnelle. Le fait de laisser une tierce personne exercer une trop forte influence à l’égard de vos valeurs de travail est une des erreurs les plus communes que les gens font dans le choix de carrière. Saisissez l’occasion de réfléchir sur ce domaine essentiel et de vous assurer que vous savez ce qui est réellement important pour vous.</p>

